-- ACV Policy Flg CASE WHEN NBM.SERVICE_FLG = 'N' AND EX.SERVICE_FLG='N' AND COALESCE (EX.EXCLUDE_FLAG,'N') = 'Y' THEN 'Y' WHEN NBM.SERVICE_FLG = 'Y' AND COALESCE (EX.EXCLUDE_FLAG,'N') = 'Y' THEN 'Y' WHEN NBM.XCAT_FLG ='Y' AND P.RU_BK_PRODUCT_FAMILY_ID = 'WBXEE' AND(NSO.BK_DEAL_ID IN ('16621975','16922373','6922383','16897335','16901905','17684649') OR NBM.DV_DEAL_ID IN ('16621975','16922373','6922383','16897335','16901905','17684649')) THEN 'Y' WHEN FDM.BK_DEAL_ID IS NOT NULL THEN 'Y' ELSE 'N' END AS ACV_POLICY_FLG,
-- PID to Term CASE WHEN DV_SERVICE_PRODUCT_FLAG = 'SOFTWARE' THEN (CASE WHEN P.PRICING_UNIT_NAME = 'YEAR' THEN P.PRICING_UNIT_DURATION_INT * 12 WHEN P.PRICING_UNIT_NAME = 'MONTHS' THEN P.PRICING_UNIT_DURATION_INT WHEN P.PRICING_UNIT_NAME = 'DAYS' THEN (CAST(P.PRICING_UNIT_DURATION_INT AS DECIMAL(15,6)) * 12)/365 END) WHEN DV_SERVICE_PRODUCT_FLAG = 'SERVICE' THEN NULL ELSE NULL END AS PID_TO_TERM_1,
