CASE WHEN NBM.RU_SERVICE_CONTRACT_END_DTM NOT IN ('1900-01-01 00:00:00' , '3500-01-01 00:00:00') AND NBM.RU_SERVICE_CONTRACT_END_DTM IS NOT NULL AND NBM.RU_SERVICE_CONTRACT_END_DTM > NBM.RU_SERVICE_CONTRACT_START_DTM AND CAST(NBM.RU_SERVICE_CONTRACT_END_DTM AS DATE) <= ADD_MONTHS(CURRENT_DATE,240) THEN CAST(NBM.RU_SERVICE_CONTRACT_END_DTM AS DATE) END AS BKGS_CONTRACT_END_DT, CASE WHEN BKGS_CONTRACT_START_DT IS NOT NULL AND BKGS_CONTRACT_END_DT IS NOT NULL THEN CAST((BKGS_CONTRACT_END_DT - BKGS_CONTRACT_START_DT) AS DECIMAL(15,6)) * 12/365 WHEN NBM.DV_CONTRACT_DURATION IS NOT NULL AND NBM.DV_CONTRACT_DURATION > 0 AND NBM.DV_CONTRACT_DURATION <= 240 THEN NBM.DV_CONTRACT_DURATION END AS DV_BKGS_CONTRACT_DURATION, -- BKGS_CISCO_BOOKED_DT CASE WHEN NBM.DD_CISCO_BOOKED_DTM NOT IN ('1900-01-01 00:00:00' , '3500-01-01 00:00:00') THEN CAST(NBM.DD_CISCO_BOOKED_DTM AS DATE) END AS BKGS_CISCO_BOOKED_DT, -- Look Up Duration CASE WHEN (DV_SOL_CONTRACT_DURATION IS NOT NULL AND DV_SOL_CONTRACT_DURATION > 0) THEN DV_SOL_CONTRACT_DURATION WHEN (SOLV1_CONTRACT_DURATION IS NOT NULL AND SOLV1_CONTRACT_DURATION > 0) THEN SOLV1_CONTRACT_DURATION WHEN (DV_SVC_CONTRACT_DURATION IS NOT NULL AND DV_SVC_CONTRACT_DURATION > 0) THEN DV_SVC_CONTRACT_DURATION WHEN (DV_BKGS_CONTRACT_DURATION IS NOT NULL AND DV_BKGS_CONTRACT_DURATION > 0) THEN DV_BKGS_CONTRACT_DURATION WHEN COALESCE(PID_TO_TERM,0) > 0 THEN PID_TO_TERM ELSE 12 END AS LKP_CONTRACT_DURATION,
