-- NEW_SERVICE_CONTRACT_START_DTM CASE WHEN (DV_SOL_CONTRACT_DURATION IS NOT NULL AND DV_SOL_CONTRACT_DURATION > 0) THEN SOL_CONTRACT_START_DT WHEN (SOLV1_CONTRACT_DURATION IS NOT NULL AND SOLV1_CONTRACT_DURATION > 0) THEN COALESCE(SOL_CONTRACT_START_DT,BKGS_CISCO_BOOKED_DT,NBM.BOOKINGS_PROCESS_DATE) WHEN (DV_SVC_CONTRACT_DURATION IS NOT NULL AND DV_SVC_CONTRACT_DURATION > 0) THEN SVC_CONTRACT_START_DT WHEN (BKGS_CONTRACT_START_DT IS NOT NULL AND BKGS_CONTRACT_END_DT IS NOT NULL) THEN BKGS_CONTRACT_START_DT ELSE COALESCE(BKGS_CISCO_BOOKED_DT,NBM.BOOKINGS_PROCESS_DATE) END AS NEW_SERVICE_CONTRACT_START_DTM,
-- NEW_SERVICE_CONTRACT_END_DTM CASE WHEN FLOOR(NEW_CONTRACT_DURATION) = CEIL(NEW_CONTRACT_DURATION) THEN ADD_MONTHS(NEW_SERVICE_CONTRACT_START_DTM, CAST(NEW_CONTRACT_DURATION AS INTEGER)) - 1 ELSE NEW_SERVICE_CONTRACT_START_DTM + (ROUND((NEW_CONTRACT_DURATION / 12.000000) * 365)) END AS NEW_SERVICE_CONTRACT_END_DTM,
CASE WHEN ACV_POLICY_FLG = 'Y' THEN 'ACV Policy' WHEN (DV_SOL_CONTRACT_DURATION IS NOT NULL AND DV_SOL_CONTRACT_DURATION > 0) THEN 'SOL Dates to Term' WHEN (SOLV1_CONTRACT_DURATION IS NOT NULL AND SOLV1_CONTRACT_DURATION > 0) THEN 'SOL Term' WHEN (DV_SVC_CONTRACT_DURATION IS NOT NULL AND DV_SVC_CONTRACT_DURATION > 0) THEN 'SRVC CNTRCT Dates to Term' WHEN BKGS_CONTRACT_START_DT IS NOT NULL AND BKGS_CONTRACT_END_DT IS NOT NULL THEN 'BKGS MSR Dates to Term' WHEN NBM.DV_CONTRACT_DURATION IS NOT NULL AND NBM.DV_CONTRACT_DURATION > 0 THEN 'BKGS MSR Term' WHEN COALESCE(PID_TO_TERM,0) > 0 THEN 'PID to Term' ELSE 'Default Term' END AS DV_ENRICHMENT_RULE_DESC,
-- NEW_MTHLY_RCR_REV_TRXL_USD_AMT NBM.DD_COMP_US_NET_PRICE_AMOUNT / NEW_CONTRACT_DURATION AS NEW_MTHLY_RCR_REV_TRXL_USD_AMT,
-- NEW_ANNLZD_MTHY_RCRR_RV_USD_AMT NEW_MTHLY_RCR_REV_TRXL_USD_AMT * 12.000000 AS NEW_ANNLZD_MTHY_RCRR_RV_USD_AMT
FROM $$WORKDB.W_BOOKINGS_MEASURE WBM INNER JOIN $$FINLGLVWDB.N_AR_TRX_LINE NATL ON NATL.AR_TRX_LINE_KEY=WBM.DV_AR_TRX_LINE_KEY AND NATL.SS_CODE IN ('CG','OPL') INNER JOIN $$STGDB.WI_SM_BOOKINGS_MEASURE_INC_TEMP INC ON (WBM.BOOKINGS_MEASURE_KEY = INC.BOOKINGS_MEASURE_KEY AND WBM.BKGS_MEASURE_TRANS_TYPE_CODE=INC.BKGS_MEASURE_TRANS_TYPE_CODE AND WBM.BOOKINGS_PROCESS_DATE=INC.BOOKINGS_PROCESS_DATE) INNER JOIN $$SLSORDVWDB.N_BOOKINGS_MEASURE NBM ON ( WBM.BOOKINGS_MEASURE_KEY = NBM.BOOKINGS_MEASURE_KEY AND WBM.BKGS_MEASURE_TRANS_TYPE_CODE=NBM.BKGS_MEASURE_TRANS_TYPE_CODE AND WBM.BOOKINGS_PROCESS_DATE=NBM.BOOKINGS_PROCESS_DATE ) INNER JOIN $$COMREFVWDB.N_PRODUCT P ON (P.ITEM_KEY = NBM.PRODUCT_KEY) LEFT JOIN $$SLSORDVWDB.N_SALES_ORDER_TV NSO ON NBM.SALES_ORDER_KEY = NSO.SALES_ORDER_KEY LEFT JOIN $$COMREFVWDB.N_PRODUCT_FAMILY NPF ON P.RU_BK_PRODUCT_FAMILY_ID=NPF.BK_PRODUCT_FAMILY_ID LEFT JOIN $$SLSORDVWDB.N_SALES_ORDER_LINE_TV SOL ON ( SOL.SALES_ORDER_LINE_KEY = NBM.DV_SALES_ORDER_LINE_KEY AND SOL.END_TV_DATETIME = '3500-01-01 00:00:00' )
LEFT JOIN $$SLSORDVWDB.N_SALES_ORDER_LINE_V1_TV SOLV1 ON ( NBM.DV_SALES_ORDER_LINE_KEY = SOLV1.SALES_ORDER_LINE_KEY AND SOLV1.END_TV_DTM = '3500-01-01 00:00:00' ) LEFT JOIN (SELECT BK_SERVICE_CONTRACT_NUM ,SALES_ORDER_LINE_KEY ,MIN(BK_SVC_CNTRCT_LINE_START_DTM) AS SERVICE_CONTRACT_START_DTM ,MAX(SVC_CNTRCT_LINE_END_DTM) AS SERVICE_CONTRACT_END_DTM FROM $$SERVICEVWDB.N_SVC_CNTRCT_LN_TECH_SERVICES WHERE SALES_ORDER_LINE_KEY > 0 GROUP BY BK_SERVICE_CONTRACT_NUM,SALES_ORDER_LINE_KEY ) SVC ON (SVC.BK_SERVICE_CONTRACT_NUM = SOL.RU_SERVICE_CONTRACT_NUMBER AND SVC.SALES_ORDER_LINE_KEY = SOL.SALES_ORDER_LINE_KEY) LEFT JOIN $$FINLGLVWDB.N_FCM_DEAL_MAPPING FDM ON (NBM.DV_DEAL_ID = FDM.BK_DEAL_ID AND NBM.DV_FISCAL_YEAR_MTH_NUMBER_INT = FDM.BK_DV_FISCAL_YEAR_MTH_NUM_INT) LEFT JOIN $$STGDB.WI_SUBMET_ATCCV_EXCLUDE_CNFG EX ON EX.EXCLUDE_VALUE = ( CASE WHEN EX.EXCLUDE_REF_COLUMN_1 = 'RU_BK_PRODUCT_FAMILY_ID' THEN P.RU_BK_PRODUCT_FAMILY_ID WHEN EXCLUDE_REF_COLUMN_1 = 'ADJUSTMENT_CODE' THEN NBM.ADJUSTMENT_CODE WHEN EXCLUDE_REF_COLUMN_1 = 'BK_PRODUCT_ID' THEN P.BK_PRODUCT_ID WHEN EXCLUDE_REF_COLUMN_1='BK_BUSINESS_UNIT_ID' THEN NPF.BK_BUSINESS_UNIT_ID END )
WHERE 1=1 AND NBM.BKGS_MEASURE_TRANS_TYPE_CODE = 'AR'
)WBM SET DV_ENRICHED_SERVICE_CONTRACT_START_DT=WBM.NEW_SERVICE_CONTRACT_START_DTM, DV_ENRICHED_SERVICE_CONTRACT_END_DT=WBM.NEW_SERVICE_CONTRACT_END_DTM, DV_ENRICHED_CONTRACT_DURATION=WBM.NEW_CONTRACT_DURATION, DV_ENRICHMENT_RULE_DESC=WBM.DV_ENRICHMENT_RULE_DESC, DV_MTHLY_RCR_REV_TRXL_USD_AMT= COALESCE(WBM.NEW_MTHLY_RCR_REV_TRXL_USD_AMT,0), DV_ANNLZD_MTHY_RCRR_RV_USD_AMT= COALESCE(WBM.NEW_ANNLZD_MTHY_RCRR_RV_USD_AMT,0) WHERE NBM.BKGS_MEASURE_TRANS_TYPE_CODE='AR' AND NBM.BOOKINGS_MEASURE_KEY = WBM.BOOKINGS_MEASURE_KEY AND NBM.BKGS_MEASURE_TRANS_TYPE_CODE=WBM.BKGS_MEASURE_TRANS_TYPE_CODE AND NBM.BOOKINGS_PROCESS_DATE=WBM.BOOKINGS_PROCESS_DATE AND NBM.DV_FISCAL_YEAR_MTH_NUMBER_INT=CNTL.FISCAL_YEAR_MTH_NUMBER_INT;
/* Update for enriched end customer key columns*/
UPDATE NBM FROM $$SLSORDVWDB.N_BOOKINGS_MEASURE NBM, $$WORKDB.W_BOOKINGS_MEASURE WBM, $$ETLVWDB.BKG_PROCESS_DT_CNTRL CNTL SET ENRICHED_END_CUSTOMER_KEY=NBM.DV_END_CUSTOMER_KEY, DV_ENRICHED_UNK_END_CUST_RULE_DESC='Bookings End Customer', EDW_UPDATE_DATETIME= CURRENT_TIMESTAMP(0) /* added as part of CR CHG0454670 */ WHERE NBM.BKGS_MEASURE_TRANS_TYPE_CODE IN ('AR') AND NBM.DV_ENRICHMENT_RULE_DESC IS NOT NULL AND NBM.BOOKINGS_MEASURE_KEY = WBM.BOOKINGS_MEASURE_KEY AND NBM.BKGS_MEASURE_TRANS_TYPE_CODE=WBM.BKGS_MEASURE_TRANS_TYPE_CODE AND NBM.BOOKINGS_PROCESS_DATE=WBM.BOOKINGS_PROCESS_DATE AND NBM.DV_FISCAL_YEAR_MTH_NUMBER_INT=CNTL.FISCAL_YEAR_MTH_NUMBER_INT;
